import logo from "./logo.svg";
import "./App.css";
import Header from "./Header.js";
import { Content } from "./Content.js";
import { Footer } from "./Footer.js";

function App() {
  return (
    <div className="App">
      <Header />
      <Content />
      <Footer />
    </div>
  );
}

export default App;
